type TransactionIconType = {
  txnDescription: string
}
export default function TransactionIcon({
  txnDescription
}: TransactionIconType) {
  switch (true) {
    case txnDescription.includes('P50'):
      return <VoucherFifty />
    case txnDescription.includes('P100'):
      return <VoucherOneHundred />
    case txnDescription.includes('P200'):
      return <VoucherTwoHundred />
    case txnDescription.includes('P300'):
      return <VoucherThreeHundred />
    case txnDescription.includes('Store Purchase'):
      return <StorePurchase />
    case txnDescription.includes('Birthday'):
      return <Birthday />
    case txnDescription.includes('Cup Point'):
      return <CupPoint />
    case txnDescription.includes('Attendance'):
      return <Attendance />
    default:
      return <Gift />
  }
}
